import { PlatformRole, PrismaClient, Gender } from '@prisma/client';
import { hashPassword } from '@/lib/password';

// Initialize Prisma Client
const prisma = new PrismaClient();

async function main() {
  // Generate a salt
  const password = 'admin123';
  const hashedPassword = await hashPassword(password);

  await prisma.accountClub.deleteMany({});
  await prisma.accountClubRole.deleteMany({});
  // Remove any existing user with the same email
  await prisma.account.deleteMany({
    //where: { email: "ricardo@diasantos.com" },
  });
  console.log(`Deleted all accounts.`);
  await prisma.club.deleteMany({});
  console.log(`Deleted all clubs`);
  const createdClub = await prisma.club.create({
    data: {
      name: 'Vitoria SC',
      shortName: 'VSC',
      location: 'PavilhÃ£o Vimaranense',
      backgroundColor: '#ffffff',
      foregroundColor: '#000000',
      season: '2024/2025',
      image:
        'data:image/png;base64,',
    },
  });
  console.log(`Created club ${createdClub.name}`);
  // Store the user in the database
  const createdAccount = await prisma.account.create({
    data: {
      name: 'Ricardo Santos', // Replace with desired name
      email: 'ricardo@diasantos.com', // Replace with desired email
      password: `${hashedPassword}`, // Store salt and hash in the format `salt:hash`,
      role: PlatformRole.ADMIN,
      defaultClubId: createdClub.id,
    },
  });
  console.log(
    `Created account ${createdAccount.id} with name ${createdAccount.name} and password ${createdAccount.password}`,
  );
  // Link the account to the club
  await prisma.accountClub.create({
    data: {
      accountId: createdAccount.id,
      clubId: createdClub.id,
      roles: {
        create: [
          {
            role: 'ADMIN', // Ensure this matches the role schema in your Prisma model
          },
        ],
      },
    },
  });
  console.log('Linked account to the club');

  await prisma.echelon.createMany({
    data: [
      { minAge: 6, maxAge: 7, name: "S8", description: "Sub8", gender: Gender.COED },
      { minAge: 8, maxAge: 9, name: "S10", description: "Sub10", gender: Gender.COED },
      { minAge: 12, maxAge: 13, name: "S14M", description: "Sub14 Masculino", gender: Gender.MALE },
      { minAge: 14, maxAge: 15, name: "S16M", description: "Sub16 Masculino", gender: Gender.MALE },
      { minAge: 16, maxAge: 17, name: "S18M", description: "Sub18 Masculino", gender: Gender.MALE }]
  })
  console.log('Created the echelons.')
}

main()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(async () => {
    await prisma.$disconnect();
  });
